import React from 'react';
import CourseCarousel from './CourseCarousel'; // Assuming you have a CourseCarousel component

const ThreeCourseCarousels = () => {
  const carouselContainerStyle = {
    marginBottom: '20px', // Adjust the margin as needed
  };

  return (
    <div>
      <div style={carouselContainerStyle}>
        <CourseCarousel />
      </div>
      <div style={carouselContainerStyle}>
        <CourseCarousel />
      </div>
      <div style={carouselContainerStyle}>
        <CourseCarousel />
      </div>
    </div>
  );
};

export default ThreeCourseCarousels;
